import React from 'react'

const Box = ({ img, title }) => {
  return (
    <div className='main-box'>
      <img src={img} alt="" />
      <div>
        <span>{title}</span>
        <span>1520 طلب</span>
      </div>
    </div>
  )
}

export default Box
